import React from 'react';
// import {render} from 'react-dom';

export default function Article(props) {
  const {article}=props;
  const body='Etiam cursus nibh eget imperdiet varius. Morbi bibendum nisl a lacus aliquam vehicula. Sed imperdiet eget odio ac venenatis. Cras cursus odio vitae neque congue, eget vestibulum ex volutpat. Curabitur eget urna ligula. Pellentesque velit metus, egestas eget sodales vitae, aliquam ut mi. Morbi dui sapien, congue sed lectus sit amet, condimentum euismod dui. Nunc pretium augue dolor, dictum commodo nisl consequat ac.';
  return (
    <article className="article">
      <header className="article__header">
        <time dateTime="new Date()">Published: {(new Date(article.dataDate)).toDateString()}</time>
      </header>
      <h2 className="article__header">{article.title}</h2>
      <div className="article__body">
        {article.content}
      </div>
      <footer className="article__footer">
        <time dateTime="new Date(article.date)">Published: {(new Date(article.dataDate)).toDateString()}</time>
        <span className="article__author" rel="author">{article.author}</span>
      </footer>
    </article>
  );
}
